import React from "react"

const StartButton = (props) => {

    const StartHandler = () => {
        alert(props.greeting)
    }

    const divStyle = {
        color
    }

    return (
        <div style={divStyle}>
            <button onClick={StartHandler}>{props.greeting}</button>
        </div>
    )
}

export default StartButton
